item.description:
ZoomInfo data is highly dynamic, with contacts, companies and related data being constantly updated in real-time in our database. Naturally, our clients want these changes to be delivered in real-time for the records they've already purchased using the ZoomInfo API - that's where webhooks come in.

## Why webhooks?

Organizations with ZoomInfo API access use the API's endpoints to search for, export, and enrich records to their integrated applications. While you can regularly poll for updates to contact and company records you've already enriched using the API, manually querying the entire database is not the best use of your time. A more efficient method is to configure webhooks to automatically update you when there is a change to a record you’ve purchased. Once configured, Webhooks will listen for events you subscribe to and automatically send over all (or only relevant) updates securely to your application.

## Monitoring API/Webhooks basics

Available to organizations with the Scaling API, the Monitoring API is a set of endpoints that allows for the configuration of webhooks subscriptions that specify:

- **Webhook Title**: Name of the webhook.
- **Subscription**: The events you are listening for, consisting of object types and event types.
    - **Object types**: The types of records you want to update. Supported object types are Contact and Company.
    - **Event types**: The events that trigger a webhook's response. Currently, the only supported event is Update.
- **Changed attributes**: This is a JSON object that includes a list of fields that are changed as part of a payload.
- **Payload types (full payload/changed attributes only)**:
    - A full payload (all fields for a contact or company, including changed attributes)
    - Only the changed attributes for a contact or company.
- **Target URL**: The target URL to which the webhook JSON payloads are sent.
- **Verification Token**: Signature token that will be part of the request we send to you.


## Securing the data transfer

To secure communication between ZoomInfo and your app, a _verification token_ is generated when you create the webhook. When data is sent to your target URL using a POST request, this verification token will be included in the request header (_x-zoominfo-token_) and can be used in your app to authorize receipt of the data from ZoomInfo.

The initial token is generated when you create a webhook. To maintain security for your webhook over time, you can periodically generate a new verification token using the [Generate Verification Token](#9cc75e99-622e-4aa2-b9a8-2d33d0ede2ed) webhook.

## Considerations

Note the following considerations:

- To use the Monitoring API/webhooks, you must have access to the Scaling API.
- To subscribe to events, you must have already enriched at least one contact or company record using the API.
- You will only receive updates on records that you've purchased using the API within the past 12 months.
- The default payload type for company or contact updates is the full payload with changed attributes.

- The maximum number of profiles delivered in a single webhook payload is 25.


## Payload examples

Here are examples of the POST requests your webhook's target URL will receive.

For contact and company records, you can choose to receive a full payload of all possible fields for a record (including changed attributes), or a payload including only the changed attributes for a record.

In either case (full or changed attributes only), contact and company records will always include the following fields to support mapping the profile:

**Contacts**: `id`, `firstName`, `lastName`, and `email`

**Companies**: `id`, `name`, and `website`

The following examples are provided below:

- Example 1: Contact record - full profile (default)
- Example 2: Contact record - changed attributes only
- Example 3: Company record - full profile (default)
- Example 4: Company record - changed attributes only


